{

}

void CARTViewBase::setupScreen()
{

}

void CARTViewBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &backButton)
    {
        //GoMain
        //When backButton clicked change screen to MAIN
        //Go to MAIN with screen transition towards East
        application().gotoMAINScreenWipeTransitionEast();
    }
    if (&src == &cartButton)
    {
        //goOrder
        //When cartButton clicked change screen to ORDER
        //Go to ORDER with screen transition towards West
        application().gotoORDERScreenWipeTransitionWest();
    }
    if (&src == &paymentButton)
    {
        //showPay
        //When paymentButton clicked show PayArea
        //Show PayArea
        PayArea.setVisible(true);
        PayArea.invalidate();
    }
    if (&src == &NO)
    {
        //onNoButtonClicked
        //When NO clicked hide PayArea
        //Hide PayArea
        PayArea.setVisible(false);
        PayArea.invalidate();
    }
    if (&src == &YES)
    {
        //transmittInfo
        //When YES clicked call virtual function
        //Call transmittInfo
        transmittInfo();
    
        //hidePay
        //When transmittInfo completed hide PayArea
        //Hide PayArea
        PayArea.setVisible(false);
        PayArea.invalidate();
    }
}
